import React, { useState, useEffect } from "react";

function Users() {
  return (
    <div className="person">
      <img
        className="avatar"
        src="https://th.bing.com/th/id/R.1d6b785b18a8e2af61131c23c6db682f?rik=Oh8OzIlh4j082g&riu=http%3a%2f%2feverydayfeminism.com%2fwp-content%2fuploads%2f2015%2f01%2fMan-Smiling-with-Beard.jpg&ehk=4Ke6RUXCVcyyAUG3GpS3LVLVYNPeMnfNfBZGUjSaMHo%3d&risl=&pid=ImgRaw&r=0"
      ></img>
      <div className="info"></div>
      <h1>Devid Fincher</h1>
      <p>devid.fincher@gmail.com</p>
    </div>
  );
}

function Invit() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("https://reqres.in/api/users")
      .then((res) => {
        if (!res.ok) {
          throw new Error("Network response was not ok");
        }
        return res.json();
      })
      .then((json) => {
        setUsers(json.data);
      })
      .catch((err) => {
        console.warn(err);
        alert("An error occurred");
      });
  }, []);
  return (
    <div className="invit">
      <div className="invit_content">
        <Users />
        <button>send offer</button>
      </div>
    </div>
  );
}

export default Invit;
